import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import PlayerPicksPage from "./components/PlayerPicksPage";
import ViewPicksPage from "./ViewPicksPage";
import AdminUploadPage from "./components/AdminUploadPage";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<PlayerPicksPage />} />
        <Route path="/view" element={<ViewPicksPage />} />
        <Route path="/admin" element={<AdminUploadPage />} />
      </Routes>
    </Router>
  );
}

export default App;
